import ReactDom from "react-dom";

function BookList() {
  return (
    <section>
      <Book />
    </section>
  );
}

const Book = () => {
  return (
    <article>
      <Image />
    </article>
  );
};

const Image = () => <img src="" />;

ReactDom.render(<BookList />, document.getElementById("root"));
